import { useState } from "react";
import FormInput from "./FormInput";
import TodoList from "./TodoList";

const Todo = () => {
  const [todos, setTodos] = useState({
    id:"",
    todo:"",
    author:""
  }); //used for storing todo data
  return (
    <div>
      <FormInput/>
      <TodoList todos={todos} setTodos={setTodos}/>
    </div>
  );
}
export default Todo;
